const CardList = (props) =>{
  const {name, email , id} = props;
  return(
    <div className="bg-light-green dib br3 pa3 ma2 grow">
      <img src={`https://robohash.org/${props.id} ?250x250`} alt="" />
      <h2>{name}</h2>
      <p>{email}</p>
    </div>
  )
}

export default CardList;
